import React from 'react';
import { NavLink, Link } from 'react-router-dom';

function Page() {
  return (
    <div className='navbar'>
      <div className='logo'>
        ayako
      </div>
      <div className='navigation'>
        <ul>
          <li>
            <Link to='new-arrivals' >New Arrivals</Link>
          </li>
        </ul>
      </div>
    </div>
  );
}

export default Page;
